  input: TEXT,F3XA,,"This statement addresses your inquiries referenced in your letter
    of September 6, 2006 on Schedule B concerning our contributions to the campaigns
    of (i) Adrian Smith for Congress, (ii) Conaway for Congress, (iii) Hobson for
    Congress, (iv) Jim Costa for Congress, (v) Judge John Carter for Congress Committee
    and (vi) Nelson for US Senate.  As of Tuesday, October 3, 2006, written requests
    for refunds of our contributions to those campaigns have been made as the condiition
    for redesignation of those funds cannot be satisfied.  Copies of said letters
    have been forwarded to the Federal Election Commission to the attention of Andria
    Needles, Campaign Finance Analyst.   Also, with regards to our contribution to
    Costello for Congress, you indicated that the committee was terminated in 2002.  That
    particular committee was inadvertently selected and has been corrected to reflect
    the proper committee which is Costello for Congress Committee, Belleville, IL.  Lastly,
    Commission Regulations require that committees disclose the identification of
    all individuals who contribute in excess of $200.00.  Our report has been amended
    to provide the missing information."
